// ==UserScript==
// @name         WaniKani 100% Review Fanfare
// @namespace    http://joncousins.co.uk
// @description  100% review score is hard! Congratulate yourself with a wonderful fanfare!
// @version      0.3.1
// @author       Jon Cousins
// @include     http://www.wanikani.com/*
// @include     https://www.wanikani.com/*
// @include     http://wanikani.com/*
// @include     https://wanikani.com/*
// @include     http://preview.wanikani.com/*
// @include     https://preview.wanikani.com/*
// @grant        none
// @run-at    document-end
// ==/UserScript==

(function() {
    'use strict';
  //
  // CONFIG OPTIONS
  //
  var VOLUME = 1.0;   //Edit this to change sound volume - 0.5 is half, 1.0 is full
  //
  // END CONFIG DONT EDIT BELOW
  //

    var base64audio, reviewPercentage, timeSinceReview, theSound;
    var reviewResultElement = document.querySelector('#review-stats-answered-correctly .review-stats-value');

    /* If this is true, you're probably not on the review page */
    if (reviewResultElement == null) {
        return;
    }

    /* use try/catch in case the browser has a wobbly over the variable length */
    try {
        base64audio = `data:audio/mpeg;base64,`;
        reviewPercentage = +reviewResultElement.textContent.trim();
        timeSinceReview = (Date.now() - new Date(document.querySelector('#last-session-date time').dateTime)) / 1000;
    } catch (e) {
        console.error(e);
    }

    /* Review percentage not 100%! No sound for youuuu */
    if (reviewPercentage !== 100) {
        return;
    }

    /* Prevent sound being played if last review was not recent */
    if (timeSinceReview > 60) {
        return;
    }

    /* Sound effect */
    theSound = new Audio(base64audio);
    theSound.volume = VOLUME;

    /* use setTimeout to try to workaround the browser blocking autoplay */
    setTimeout(function () {
      theSound.play();
    }, 20);
})();